schemaDefinition: "create or replace view SRC_V_FACT_NEW_LOGO_TARGET_TEST3(\n\tQUARTER_ID,\n\
  \tTERRITORY_ID,\n\tGEO_ID,\n\tQUARTER_DT,\n\tQUARTER_YYQQ,\n\tNEW_LOGO_TARGET,\n\
  \tNEW_LOGO_ACE_TARGET,\n\tTERRITORY_SYSID\n) as\n\n/**********************************************************************************************************************************\n\
  * CREATE/CHANGE LOG:\n*     DATE                        MOD BY                 \
  \                    DESC\n*---------------------*-----------------------------*----------------------------------------------------------------------------\n\
  *  27/12/2023                     Avantika                     Created new veiw\
  \ as part of Self-serve 1.5 team 02/02/2024 Release\n***********************************************************************************************************************************/\n\
  \nSELECT\n    QTR.QUARTER_ID\n    ,hash(NL.\"TerritorySysID\") as TERRITORY_ID\n\
  \    ,TERR.GEO_ID\n\t,QTR.QUARTER_DT\n    ,QTR.QUARTER_YYQQ\n    ,NL.\"NewLogoTargets\"\
  \ as NEW_LOGO_TARGET\n    ,NL.\"NewLogoTargetsACE\" as NEW_LOGO_ACE_TARGET\n   \
  \ ,NL.\"TerritorySysID\" as TERRITORY_SYSID\n  FROM EDW_LS.SALES_EM.EM_SALES_NEWLOGO_TARGETS\
  \ NL\n  LEFT OUTER JOIN EDW.ENTERPRISE.DIM_QUARTER QTR  ON NL.\"Quarter\" = QTR.QUARTER_YYQQ\n\
  \  LEFT OUTER JOIN  EDW.ENTERPRISE.DIM_TERRITORY TERR ON NL.\"TerritorySysID\" =\
  \ TERR.TERRITORY_SYSID;"
